import React from 'react'

export default function Accordion(props) {
    const recipes = props.recipes

    return (
       <div>
        {recipes.map(recipe => {
            return (
            <div class="accordion" id="accordion{recipe.key}">
                <div class="accordion-item">
                    <h2 class="accordion-header" id="heading{recipe.key}">
                    <button class="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#{recipe.key}" aria-expanded="true" aria-controls="{recipe.key}">
                        {recipe.name}
                    </button>
                    </h2>
                    <div id="{recipe.key}" class="accordion-collapse collapse show" aria-labelledby="heading{recipe.key}" data-bs-parent="#accordionExample">
                    <div class="accordion-body">
                        {recipe.body}
                    </div>
                    </div>
                </div>
            </div>)})}
        </div>
    )
}
